import React from 'react';
import Dashboard from "views/Dashboard.js";
import Admins from 'views/Admins';

var routes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    icon: "nc-icon nc-bank",
    component: <Dashboard />,
    layout: "/super-admin",
  },
  {
    path: "/admin-list",
    name: "Admins",
    icon: "fa-solid fa-layer-group",
    component: <Admins />,
    layout: "/super-admin",
  },
 
];
export default routes;
